/**
 * P谩gina de Dashboard
 * Dashboard principal del estudiante
 */

import React, { useEffect } from 'react';
import {
  Box,
  Container,
  Grid,
  Paper,
  Typography,
  Card,
  CardContent,
  Avatar,
  Button,
  Chip,
  IconButton,
  Stack,
} from '@mui/material';
import {
  Description,
  Logout,
  Dashboard as DashboardIcon,
  Notifications,
  School,
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import { useAuthStore } from '../store/authStore';
import PageHeader from '../components/PageHeader';

export const DashboardPage: React.FC = () => {
  const navigate = useNavigate();
  const { user, logout, isAuthenticated, loadUser } = useAuthStore();

  useEffect(() => {
    if (!isAuthenticated) {
      navigate('/login');
    } else {
      loadUser();
    }
  }, [isAuthenticated, navigate, loadUser]);

  const handleLogout = async () => {
    await logout();
    navigate('/login');
  };

  // Estad铆sticas de ejemplo
  const stats = [
    {
      icon: <Description sx={{ fontSize: 40 }} />,
      title: 'Documentos Aprobados',
      value: '0/3',
      color: '#008000',
    },
  ];

  const logoUrl = `${process.env.PUBLIC_URL}/logo-coordinacion.png`;

  return (
    <Box sx={{ minHeight: '100vh', backgroundColor: '#FFFFFF' }}>
      <PageHeader
        title="Sistema Universitario"
        subtitle="Coordinaci贸n de Sistema Abierto 路 Modalidad Mixta"
        gradientFrom="#008000"
        gradientTo="#006000"
        actions={
          <Stack direction="row" spacing={2} alignItems="center">
            <IconButton color="inherit" onClick={() => navigate('/notificaciones')} sx={{ color: '#FFFFFF' }}>
                <Notifications />
              </IconButton>
              <Button
                variant="outlined"
                color="inherit"
                startIcon={<Logout />}
                onClick={handleLogout}
                sx={{ 
                  borderColor: '#FFFFFF', 
                  color: '#FFFFFF',
                  '&:hover': { 
                    borderColor: '#FFFFFF', 
                  backgroundColor: 'rgba(255,255,255,0.1)',
                },
                }}
              >
                Cerrar Sesi贸n
              </Button>
          </Stack>
        }
      />

      <Container>
        {/* Informaci贸n del Usuario */}
        <Paper sx={{ p: 3, mb: 3, borderRadius: 2 }}>
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 3 }}>
            <Avatar
              sx={{
                width: 80,
                height: 80,
                bgcolor: 'primary.main',
                fontSize: '2rem',
              }}
            >
              {user?.nombre?.charAt(0).toUpperCase() || 'U'}
            </Avatar>
            <Box sx={{ flex: 1 }}>
              <Typography variant="h5" fontWeight="bold" gutterBottom>
                隆Bienvenido, {user?.nombre || 'Usuario'}!
              </Typography>
              <Typography variant="body1" color="text.secondary" gutterBottom>
                {user?.email}
              </Typography>
              <Chip
                label={user?.rol || 'ESTUDIANTE'}
                color="primary"
                size="small"
                sx={{ mt: 1 }}
              />
            </Box>
          </Box>
        </Paper>

        {/* Estad铆sticas */}
        <Grid container spacing={3} sx={{ mb: 3 }}>
          {stats.map((stat, index) => (
            <Grid item xs={12} key={index}>
              <Card
                sx={{
                  borderRadius: 2,
                  border: '2px solid #008000',
                }}
              >
                <CardContent>
                  <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center', gap: 3 }}>
                    <Box
                      sx={{
                        backgroundColor: stat.color,
                        color: 'white',
                        borderRadius: 2,
                        p: 2,
                        display: 'flex',
                        alignItems: 'center',
                        justifyContent: 'center',
                      }}
                    >
                      {stat.icon}
                    </Box>
                    <Box sx={{ textAlign: 'center' }}>
                      <Typography variant="h3" fontWeight="bold" sx={{ color: '#008000' }}>
                        {stat.value}
                      </Typography>
                      <Typography variant="h6" color="text.secondary">
                        {stat.title}
                      </Typography>
                    </Box>
                  </Box>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>

        {/* Accesos R谩pidos */}
        <Typography variant="h5" fontWeight="bold" sx={{ mb: 2, color: '#000000' }}>
          Acciones Principales
        </Typography>
        <Grid container spacing={3}>
          <Grid item xs={12} md={6}>
            <Button
              fullWidth
              variant="contained"
              size="large"
              startIcon={<Description />}
              onClick={() => navigate('/documentos')}
              sx={{ 
                height: 100, 
                borderRadius: 2, 
                fontSize: '1.2rem',
                backgroundColor: '#008000',
                '&:hover': {
                  backgroundColor: '#006000',
                },
              }}
            >
              Subir Documentos
            </Button>
          </Grid>
          <Grid item xs={12} md={6}>
            <Button
              fullWidth
              variant="outlined"
              size="large"
              startIcon={<Notifications />}
              onClick={() => navigate('/notificaciones')}
              sx={{ 
                height: 100, 
                borderRadius: 2, 
                fontSize: '1.2rem',
                borderColor: '#008000',
                color: '#008000',
                borderWidth: 2,
                '&:hover': {
                  borderColor: '#006000',
                  backgroundColor: 'rgba(0, 128, 0, 0.04)',
                  borderWidth: 2,
                },
              }}
            >
              Ver Notificaciones
            </Button>
          </Grid>
          <Grid item xs={12}>
            <Button
              fullWidth
              variant="outlined"
              size="large"
              startIcon={<Description />}
              onClick={() => navigate('/creditos')}
              sx={{
                height: 100,
                borderRadius: 2,
                fontSize: '1.2rem',
                borderColor: '#008000',
                color: '#008000',
                borderWidth: 2,
                '&:hover': {
                  borderColor: '#006000',
                  color: '#006000',
                  borderWidth: 2,
                },
              }}
            >
              Gestionar Cr茅ditos Complementarios
            </Button>
          </Grid>
        </Grid>

        {/* Informaci贸n Importante */}
        <Box sx={{ mt: 4 }}>
          <Typography variant="h5" fontWeight="bold" sx={{ mb: 2, color: '#000000' }}>
            Informaci贸n Importante
          </Typography>
          <Paper sx={{ p: 4, borderRadius: 2, border: '1px solid #e0e0e0' }}>
            <Box sx={{ textAlign: 'center' }}>
              <Box
                component="img"
                src={logoUrl}
                alt="Coordinaci贸n"
                sx={{ width: 100, height: 100, objectFit: 'contain', mb: 2 }}
              />
              <Typography variant="h5" fontWeight="bold" sx={{ mb: 2, color: '#000000' }}>
                隆Bienvenido al Sistema de Reinscripci贸n!
              </Typography>
              <Typography variant="body1" sx={{ mb: 3, color: '#333333' }}>
                Para completar tu reinscripci贸n, debes subir los 3 documentos requeridos.
              </Typography>
              <Box sx={{ 
                bgcolor: '#f0fff0', 
                p: 3, 
                borderRadius: 2, 
                border: '2px solid #008000',
